import React, { Component } from 'react';
import Select from 'react-select';
import CMap from './CMap'

class RegisterDelivery extends Component {
	render() {
		return (
			<>
				<div>
					<div style={{float: "left"}}>
						<CMap
							healthState={new Map<0, 0>()}
							batteryState={new Map<0, 0>()}
						></CMap>
					</div>
					<div className="form-group" style={{float:"right", marginTop:"50px"}}>
						<div style={{marginBottom:"10px", marginLeft:"40px"}}>
							<img
    							src={ "https://user-images.githubusercontent.com/68888653/126869406-4d22668f-04df-44e2-a952-6c4f7f9bc15d.png" }
    							width='30px'
    							height='40px'
							/>
							<label style={{marginLeft:"20px", fontWeight:"bold"}}>Tag</label>
						</div>
						<div style={{marginBottom:"65px", marginLeft:"40px"}}>
							<img
    							src={ "https://user-images.githubusercontent.com/68888653/126869445-228df4e6-6496-4597-b12e-7a0dd11a12d8.png" }
    							width='30px'
    							height='40px'
							/>
							<label style={{marginLeft:"20px", fontWeight:"bold"}}>Station</label>
						</div>
						<div style={{marginBottom:"10px"}}>
							<label style={{fontWeight:"bold", fontSize:"25px"}}>Register Delivery</label>
						</div>
						<label>Sender Name</label>
						<input
							type="text"
							className="form-control"
							name="client_name"
							placeholder={'Enter your name'}
							style={{marginBottom:"5px", width:"270px"}}
							//value={value.value_name}
							//onChange={this.handleValueChange(idx)}
						/>
						<label>Sender Phone Number</label>
						<input
							type="text"
							className="form-control"
							name="client_name"
							placeholder={'Enter your phone number'}
							style={{marginBottom:"5px"}}
							//value={value.value_name}
							//onChange={this.handleValueChange(idx)}
						/>
						<label>Recipient Name</label>
						<input
							type="text"
							className="form-control"
							name="client_name"
							placeholder={'Enter recipient name'}
							style={{marginBottom:"5px"}}
							//value={value.value_name}
							//onChange={this.handleValueChange(idx)}
						/>
						<label>Recipient Phone Number</label>
						<input
							type="text"
							className="form-control"
							name="client_name"
							placeholder={'Enter recipient phone numeber'}
							style={{marginBottom:"5px"}}
							//value={value.value_name}
							//onChange={this.handleValueChange(idx)}
						/>
						<label>Destination Tag</label>
							<Select
								className="basic-select"
								name="sink"
								// options={sinkOptions}
								classNamePrefix="select"
								// onChange={this.handleSinkChange}
							/>
					</div>
					<div style={{float:"right", marginTop:"50px"}}>
						<button
							type="submit"
							className="btn my-2 my-sm-0" 
							// onClick={this.handleSubmit}
							style={{ background: '#82CAFA', color : 'white'}}
							>
							Register Delivery
						</button>
					</div>
				</div>
			</>
		);
	}
}

export default RegisterDelivery;
